import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [patientData, setPatientData] = useState(null); // Store encrypted data
  const [decryptedData, setDecryptedData] = useState(null); // Store decrypted data
  const [loading, setLoading] = useState(true); // Loading state

  useEffect(() => {
    // Fetch encrypted data from backend
    axios
      .get("http://127.0.0.1:5000/api/encrypt")
      .then((response) => {
        console.log("Encrypted Data:", response.data);
        setPatientData(response.data);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching encrypted data:", error);
        setLoading(false);
      });
  }, []);

  const handleDecrypt = () => {
    if (!patientData) return;

    axios
      .post("http://127.0.0.1:5000/api/decrypt", patientData)
      .then((response) => {
        console.log("Decrypted Data:", response.data);
        setDecryptedData(response.data);
      })
      .catch((error) => {
        console.error("Error decrypting data:", error);
      });
  };

  return (
    <div className="App">
      <h1>Homomorphic Encryption Demo</h1>

      {loading ? (
        <p>Loading encrypted data...</p>
      ) : (
        <div>
          <h2>Encrypted Data</h2>
          <p>Patient ID: {patientData.id}</p>
          <p>Glucose Level (Encrypted): {patientData.glucose_level}</p>
          <p>Blood Pressure (Encrypted): {patientData.blood_pressure}</p>

          <button onClick={handleDecrypt}>Decrypt Data</button>

          {decryptedData && (
            <div>
              <h2>Decrypted Data</h2>
              <p>Glucose Level: {decryptedData.glucose_level}</p>
              <p>Blood Pressure: {decryptedData.blood_pressure}</p>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
